  constructor(private reviewService: ReviewService) { }

  getBySettingId(settingId: number): Exhibit[] {
    let exhibits = this.exhibitList.filter(e => e.settingId === settingId);
    exhibits.forEach(exhibit => this.setReviewValues(exhibit));
    return exhibits;
  }

  getById(id: number): Observable<any> {
    let found = this.exhibitList.find(e => e.id === id);
    if (found) {
      found = this.setReviewValues(found);
    }
    return of(found);
  }

  private setReviewValues(exhibit: Exhibit): Exhibit {
    exhibit.reviews = this.reviewService.getByExhibitId(exhibit.id);
    if (exhibit.reviews.length !== 0)
      exhibit.averageReviewValue = exhibit.reviews.reduce((total, current) => total + current.value, 0) / exhibit.reviews.length;
    return exhibit;
  }

